import { ListGroup } from 'react-bootstrap';
import { FaPhone, FaHome, FaEnvelope, FaFacebook } from 'react-icons/fa';

const ContactDetail = () => {
    return (
        <ListGroup>
            <ListGroup.Item>
                <FaPhone />{"   -   "} 
                <span>+234 902 383 0868</span>
            </ListGroup.Item>
            <br/>
            <ListGroup.Item>
                <FaHome />{"   -   "} 
                <span>AG 40, Garki Close, Barnawa.</span>
            </ListGroup.Item>
            <br/>
            <ListGroup.Item>
                <FaEnvelope />{"   -   "} 
                <span>contact@mollysvet.com</span>
            </ListGroup.Item>
            <br/>
            <ListGroup.Item>
                <FaFacebook />{"   -   "} 
                <span>Molly's Vet</span>
            </ListGroup.Item>
        </ListGroup>
    )
}

export default ContactDetail
